import {Card} from "react-bootstrap";
import "./Bug.css"
import * as PropTypes from "prop-types";

function BugInfo({data}) {
    return <div className={"card-info-container"}>
        <Card.Text>{data}</Card.Text>
    </div>;
}

BugInfo.propTypes = {description: PropTypes.any};
const Bug = ({bugName, description}) => {
    console.log(bugName)
    console.log(description)
    return <div id={"card-entire-body"}>
        <Card style={{width: "40vw", height: "20vh"}}>
            <Card.Body>
                <Card.Title>{bugName}</Card.Title>
                <div className={"cards-info-container"}>
                    <BugInfo data={description}/>
                    <BugInfo data={description}/>
                    <BugInfo data={description}/>
                </div>
            </Card.Body>
        </Card>
    </div>
}

export default Bug
